import React from 'react';
import './Fation.css';
import Series from './Series/Series.js';
import img1 from './Resource/- (1).jpg';
import img2 from './Resource/- (2).jpg';
import img3 from './Resource/- (3).jpg';
import img4 from './Resource/- (4).jpg';
import img5 from './Resource/- (5).jpg';
import img6 from './Resource/1(1).jpg';
import img7 from './Resource/1(2).jpg';
import img8 from './Resource/2.jpg';
import img9 from './Resource/3.jpg';
import img10 from './Resource/4(1).jpg';
import img11 from './Resource/4(2).jpg';
import img12 from './Resource/5(1).jpg';
import img13 from './Resource/5(2).jpg';
import img14 from './Resource/6.jpg';
import img15 from './Resource/7.jpg';

import arka1 from './Resource/Arka/1.jpg';
import arka2o1 from './Resource/Arka/2 (1).jpg';
import arka2o2 from './Resource/Arka/2 (2).jpg';
import arka3o1 from './Resource/Arka/3 (1).jpg';
import arka3o2 from './Resource/Arka/3 (2).jpg';
import arka3o3 from './Resource/Arka/3 (3).jpg';
import arka4 from './Resource/Arka/4.jpg';
import arka5o1 from './Resource/Arka/5 (1).jpg';
import arka5o2 from './Resource/Arka/5 (2).jpg';
import arka6o1 from './Resource/Arka/6 (1).jpg';
import arka6o2 from './Resource/Arka/6 (2).jpg';
import arka7 from './Resource/Arka/7.jpg';
import arka8o1 from './Resource/Arka/8 (1).jpg';
import arka8o2 from './Resource/Arka/8 (2).jpg';
import arka9o1 from './Resource/Arka/9 (1).jpg';
import arka9o2 from './Resource/Arka/9 (2).jpg';
import arka10o1 from './Resource/Arka/10 (1).jpg';
import arka10o2 from './Resource/Arka/10 (2).jpg';
import arka11o1 from './Resource/Arka/11 (1).jpg';
import arka11o2 from './Resource/Arka/11 (2).jpg';
import arka12o1 from './Resource/Arka/12 (1).jpg';
import arka12o2 from './Resource/Arka/12 (2).jpg';
import arka13o1 from './Resource/Arka/13 (1).jpg';
import arka13o2 from './Resource/Arka/13 (2).jpg';
import arka14o1 from './Resource/Arka/14 (1).jpg';
import arka14o2 from './Resource/Arka/14 (2).jpg';

import chitraCover from './Resource/chitra/cover.jpg';
import chitra1 from './Resource/chitra/1.jpg';
import chitra2o1 from './Resource/chitra/2 (1).jpg';
import chitra2o2 from './Resource/chitra/2 (2).jpg';
import chitra3o1 from './Resource/chitra/3 (1).jpg';
import chitra3o2 from './Resource/chitra/3 (2).jpg';
import chitra4 from './Resource/chitra/4.jpg';
import chitra5o1 from './Resource/chitra/5 (1).jpg';
import chitra5o2 from './Resource/chitra/5 (2).jpg';
import chitra6 from './Resource/chitra/6.jpg';
import chitra7o1 from './Resource/chitra/7 (1).jpg';
import chitra7o2 from './Resource/chitra/7 (2).jpg';

import FaceMag21eCover from './Resource/Face_mag_March_21/cover.jpg';
import FaceMag21e1o1 from './Resource/Face_mag_March_21/1(1).jpg';
import FaceMag21e1o2 from './Resource/Face_mag_March_21/1(2).jpg';
import FaceMag21e3o1 from './Resource/Face_mag_March_21/3 (1).jpg';
import FaceMag21e3o2 from './Resource/Face_mag_March_21/3 (2).jpg';
import FaceMag21e4o1 from './Resource/Face_mag_March_21/4 (1).jpg';
import FaceMag21e4o2 from './Resource/Face_mag_March_21/4 (2).jpg';
import FaceMag21e5o1 from './Resource/Face_mag_March_21/5 (1).jpg';
import FaceMag21e5o2 from './Resource/Face_mag_March_21/5 (2).jpg';
import FaceMag21e6o1 from './Resource/Face_mag_March_21/6 (1).jpg';
import FaceMag21e6o2 from './Resource/Face_mag_March_21/6 (2).jpg';
import FaceMag21e7o1 from './Resource/Face_mag_March_21/7 (1).jpg';
import FaceMag21e7o2 from './Resource/Face_mag_March_21/7 (2).jpg';
import FaceMag21e8 from './Resource/Face_mag_March_21/8.jpg';
import FaceMag21e9o1 from './Resource/Face_mag_March_21/9 (1).jpg';
import FaceMag21e9o2 from './Resource/Face_mag_March_21/9 (2).jpg';
import FaceMag21e10 from './Resource/Face_mag_March_21/10.jpg';
import FaceMag21e11 from './Resource/Face_mag_March_21/11.jpg';

import Intertwined1 from './Resource/Intertwined/1.jpg';
import Intertwined2o1 from './Resource/Intertwined/2 (1).jpg';
import Intertwined2o2 from './Resource/Intertwined/2 (2).jpg';
import Intertwined3 from './Resource/Intertwined/3.jpg';
import Intertwined4 from './Resource/Intertwined/4.jpg';



const fashion = (props) => {
    var series1 = [[img6, img7],img8, img9,[img10,img11],[img12, img13], img14, img15];

    var arkaSeries = [arka1,[arka2o1,arka2o2],[arka3o1,arka3o2,arka3o3],arka4,[arka5o1,arka5o2],[arka6o1,arka6o2], arka7,[arka8o1,arka8o2],[arka9o1,arka9o2],[arka10o1,arka10o2],[arka11o1,arka11o2],[arka12o1,arka12o2],[arka13o1,arka13o2],[arka14o1,arka14o2]];
    var chitraSeries = [chitra1,[chitra2o1,chitra2o2],chitraCover,[chitra3o1,chitra3o2],chitra4,[chitra5o1,chitra5o2],chitra6,[chitra7o1,chitra7o2]];
    var FaceMAgSeries = [[FaceMag21e1o1,FaceMag21e1o2],[FaceMag21e3o1,FaceMag21e3o2],FaceMag21eCover,[FaceMag21e4o1,FaceMag21e4o2],[FaceMag21e5o1,FaceMag21e5o2],[FaceMag21e6o1,FaceMag21e6o2],[FaceMag21e7o1,FaceMag21e7o2],FaceMag21e8,[FaceMag21e9o1,FaceMag21e9o2],FaceMag21e10,FaceMag21e11];
    var IntertwinedSeries = [Intertwined1, [Intertwined2o1,Intertwined2o2], Intertwined3, Intertwined4];
    
    return(
        <div className="fashion">
            <h1 className="Ftitle">Fashion & People</h1>
            <Series click={props.click} app={props.app} series={arkaSeries} description="Arka"/>
            <Series click={props.click} app={props.app} series={chitraSeries} cover={chitraCover} description="Chitra"/>
            <Series click={props.click} app={props.app} series={FaceMAgSeries} cover={FaceMag21eCover} description="Face Magzine 2021"/> 
            <Series click={props.click} app={props.app} series={IntertwinedSeries} description="Intertwined"/>
            <Series click={props.click} app={props.app} series={series1} description="S"/>
        </div>
    );
};

export default fashion;
